import '../../styles/InsuranceCard.css';
import React,{Component} from 'react';
import {connect} from 'react-redux';
import {Grid, CardActionArea} from '@material-ui/core';
import {DriveEta, LocalHospital,DateRange, Store} from '@material-ui/icons';

import Card from './../Common/Card/Card';
import CardIcon from './../Common/Card/CardIcon';
import CardHeader from './../Common/Card/CardHeader';
import CardFooter from './../Common/Card/CardFooter';

import {selectTab} from './../../actions';


import styles from "./../../assets/jss/material-dashboard-react/views/dashboardStyle";

const useStyles = makeStyles(styles);

const InsuranceCard = (props) => {
    const classes = useStyles();
    return <Grid item xs = {4}>
            <CardActionArea onClick = {this.onCardClicked}>
                <Card>
                    <CardHeader color="success" stats icon>
                        <CardIcon color="success">
                            <Store />
                        </CardIcon>
                        <p className={classes.cardCategory}>Revenue</p>
                        <h3 className={classes.cardTitle}>$34,245</h3>
                    </CardHeader>
                    <CardFooter stats>
                        <div className={classes.stats}>
                            <DateRange />
                            Last 24 Hours
                        </div>
                    </CardFooter>
                </Card>
            </CardActionArea>
        </Grid>
}

export default connect(null, {selectTab})(InsuranceCard);
